import React from "react";
import { Route, Routes } from "react-router-dom";
import App from "../App";
import HomePage from "../WebsitePages/HomePage";

const index = () => {
  return (
    <Routes>
      <Route path="/" component={<App />} />
      <Route path="/goVegan" component={<HomePage />} />
    </Routes>
  );
};

export default index;
